import "./App.css";
import React from "react";

const courses = [
  "Full Stack Developement Program",
  "Python Automation Testing Program",
  "UI/UX Program",
];

function App(props) {
  const arrayDataItems = courses.map((course) => <li>{course}</li>);

  return (
    <div className="container">
      <ul>{arrayDataItems}</ul>
    </div>
  );
}

export default App;

